function emphasizeStringIn(morph, string, style) {
    var m;
    var re = new RegExp(string, "g");
    while(m = re.exec(morph.textString)) {
        var  from = m.index,
            to = m.index + m[0].length;
        morph.emphasize(style, from, to)
    }
}

