function showLayerDefinition(methodItem) {
       var info = "layer definition"
        var source = "// changes here only affect runtime \n"
        var l = methodItem.object
        source += "cop.create('" + l.name + "')\n"

        Properties.values(l)
            .select(function(ea) { return ea._layered_object })
            .each(function(ea) {
                var obj = ea._layered_object;
                source += ".refineClass('" + obj.constructor.type + "', {\n"
                Functions.own(ea).each(function(methodName) {
                    source += "    "+ methodName + ": " + ea[methodName] + ",\n"
                })
                source += "})\n"
            })
        this.get('infoText').setTextString(info)
        this.get('sourceText').setTextString(source)
}
